import * as Functions from "../stores/Functions";
export default function Logs() {
    return(
        <div>
        <h2>Logs:</h2>
        {logs && logs.map(log => {
          return (
          <div key={log._id}>
            <h3>{log.title}</h3>
            <button onClick={() => Functions.deleteLog(log._id)}>Delete</button>
            <button onClick={() => Functions.toggleUpdate(log)}>Update</button>
          </div>
        )})}
      </div>
    );
}
